const daggerCurrentUser = [
    {
        img: 'data:image/jpeg;base64,',
        title: 'Epoch',
        keyID: "1E8BE77968E9B554"
    }, {
        img: 'data:image/jpeg;base64,',
        title: 'Kloak',
        keyID: "D9895576707B16B1"
    }
];
class daggr {
    constructor() {
        this.userList = ko.observableArray(daggerCurrentUser);
        this.currentUser = ko.observable(null);
        this.searchShowLoading = ko.observable(false);
        this.textInput = ko.observable('');
        this.searchText = ko.observable('');
        this.chatData = ko.observableArray([]);
        this.adduser = ko.observable(false);
        this.searchInputText = ko.observable('');
        this.showPublicKey = ko.observable(false);
        this.showPrivateKey = ko.observable(false);
        this.publicKeyTextShowCopy = ko.observable(false);
        this.privateTextShowCopy = ko.observable(false);
        this.textInputHeight = ko.observable(3);
        this.information = {
            delivered: ['已送达', '到着した', 'Delivered', '已送達']
        };
        this.textInput.subscribe(newValue => {
            this.textInputHeight((newValue.split(/\r?\n/g).length - 1) * 1.4 + 3);
        });
    }
    messageToJson() {
        const chatData = JSON.parse(JSON.stringify(this.chatData()));
        this.chatData().forEach((v, i) => {
            chatData[i]['readTimestamp'] = v.readTimestamp();
        });
        return JSON.stringify(chatData);
    }
    saveMessage() {
    }
    selechuser(index) {
        this.currentUser(this.userList()[index]);
    }
    addUser() {
        this.userList.unshift({ img: '', title: 'newUser', keyID: this.searchInputText() });
        this.adduser(false);
    }
    getMessage(obj) {
        const messageContent = obj.Args[1];
        const message = {
            uuid: uuid_generate(),
            create: ko.observable(new Date(messageContent.create)),
            textContent: messageContent.textContent,
            readTimestamp: ko.observable(false),
            attachedFile: null,
            isSelf: false,
            rows: messageContent.textContent.split(/\r?\n/g).length
        };
        this.textInput('');
        this.chatData.unshift(message);
        window.scrollTo(0, document.body.scrollHeight);
    }
    snedMessage() {
        const message = {
            uuid: uuid_generate(),
            create: new Date().toISOString(),
            textContent: this.textInput(),
            readTimestamp: ko.observable(false),
            attachedFile: null,
            isSelf: true,
            rows: this.textInput().split(/\r?\n/g).length
        };
        const com = {
            command: 'daggr',
            Args: [this.currentUser().keyID, message],
            error: null,
            subCom: 'sendMessage',
            requestSerial: uuid_generate()
        };
        const errorProcess = (err) => {
            return console.log(err);
        };
        this.textInput('');
        //this.chatData.unshift ( message )
        window.scrollTo(0, document.body.scrollHeight);
        return _view.connectInformationMessage.emitRequest(com, (err, com) => {
            if (err) {
                return errorProcess(err);
            }
            if (!com) {
                message.create = ko.observable(null);
                this.textInput('');
                window.scrollTo(0, document.body.scrollHeight);
                return this.chatData.unshift(message);
            }
            if (com.error === -1) {
                message.create(new Date());
                return console.dir(com);
            }
            return console.dir(`_view.connectInformationMessage.emitRequest return success!`);
        });
    }
    copyPublicKey() {
        const copyText = document.getElementById("publicKeyText");
        copyText['select']();
        copyText['setSelectionRange'](0, 99999); /*For mobile devices*/
        document.execCommand("copy");
        this.publicKeyTextShowCopy(true);
        this.privateTextShowCopy(false);
    }
    copyPrivateKey() {
        const copyText = document.getElementById("privateKeyText");
        copyText['select']();
        copyText['setSelectionRange'](0, 99999); /*For mobile devices*/
        document.execCommand("copy");
        this.publicKeyTextShowCopy(false);
        this.privateTextShowCopy(true);
    }
    getHeight(index) {
        const d = document.getElementById(this.chatData()[index].uuid);
        const high = d.scrollTop + d.scrollHeight;
        return high + 'px';
    }
}
